// Import Styled
import styled from 'styled-components';

export const BtnClose = styled.text`
	position: fixed;
    right: 16px;
    top: 16px;
    z-index: 9991;
    font-size: 24px;
    margin: 0;
    color: #fff;
    cursor: pointer;
`;
